import LocalSource from "@/datasource/controller";

async function getTotalDons(){
    return LocalSource.totalDons();
}

async function getTotalDonsOf(prestId) {
    return LocalSource.getTotalDonsOf(prestId);
}

export default {
    getTotalDons,
    getTotalDonsOf
}
